import React, { useState, useEffect } from 'react'
import NavbarUser from '../../layouts/NavbarUser'
// redux
import { useSelector } from 'react-redux'

// function
import { readUsers } from '../../functions/user'

const UserDashboard = () => {
  const { user } = useSelector((state) => ({ ...state }))
  const [userdata, setUserdata] = useState([])
  console.log(user.id)
  useEffect(() => {
    loadData(user.token, user.id)
  }, [])

  const loadData = (authtoken, id) => {
    readUsers(authtoken, id)
      .then((res) => {
        setUserdata(res.data)
      })
      .catch((err) => {
        console.log(err)
      })
  }
  return (
    <div>
      <NavbarUser />
      <section>
        <div className='container py-5'>
          <div className='row'>
            <div className='col-lg-4'>
              <div class="card mb-4">
                <div class="card-body text-center">
                  <img src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-chat/ava3.webp" width='150px' alt="avatar" class="rounded-circle img-fluid" />
                  <h5 class="my-3">John Smith</h5>
                  <p class="text-muted mb-1">Full Stack Developer</p>
                  <p class="text-muted mb-4">Bay Area, San Francisco, CA</p>
                  <div class="d-flex justify-content-center mb-2">
                    <button type="button" class="btn btn-primary">Follow</button>
                    <button type="button" class="btn btn-outline-primary ms-1">Message</button>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </div>
  )
}
export default UserDashboard
